    props.onDelete(props.note.id);
  }
  return (
    <div className="note">
          {  props.note.map((item) => {
      return <ul> <li onClick={() => {handleClick(item)}}>{item.title}</li></ul>
      })}
 <button onClick={handleDelete}>DELETE</button>

      
    </div>
  );
}

